// SongButtons.js
import React from 'react';
import SongButton from './songbutton';

const SongButtons = () => {
  const songs = [
    { id: 1, name: 'Song 1' },
    { id: 2, name: 'Song 2' },
    { id: 3, name: 'Song 3' },
    { id: 4, name: 'Song 4' },
    { id: 5, name: 'Song 5' },
    { id: 6, name: 'Song 6' },
    { id: 7, name: 'Song 7' },
    { id: 8, name: 'Song 8' },
    { id: 9, name: 'Song 9' },
    { id: 10, name: 'Song 10' },
  ];

  const buttonsPerRow = 5;
  const numRows = Math.ceil(songs.length / buttonsPerRow);

  return (
    <div className="song-buttons-container">
      {[...Array(numRows)].map((_, rowIndex) => (
        <div key={rowIndex} className="song-buttons-row">
          {songs.slice(rowIndex * buttonsPerRow, (rowIndex + 1) * buttonsPerRow).map((song) => (
            <SongButton key={song.id} link="/piano" songName={song.name} />
          ))}
        </div>
      ))}
    </div>
  );
};

export default SongButtons;
